      const jccAPI = (date) => {
        const responses = {
          "2025-12": jccResponse202512,
          "2026-01": jccResponse202601,
          "2026-02": jccResponse202602,
        };

        return Object.hasOwn(responses, date)
          ? responses[date]
          : {
              data: {
                availableTimesList: [],
                appointmentDuration: 600,
              },
              success: true,
            };
      };

      // document.getElementById("jcc").dynamic = true;
      document.getElementById("jcc")?.addEventListener("visibleDateChange", (evt) => {
        const date = evt.target.visibleDate;
        const month = date.substr(0, 7);
        const response = jccAPI(month);
        if (response.success) {
          evt.target.times = response.data.availableTimesList.map((time) => {
            const date = new Date(time);
            const label = date.getHours().toString() + ":" + date.getMinutes().toString().padStart(2, "0");
            return { date, label };
          });
        }
      });
